import React from 'react';
import './Form.css';
import ReactInputVerificationCode from 'react-input-verification-code';

const Verfication = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}

    > Verfication
               <ReactInputVerificationCode />;
     
    </div>
  );
};

export default  Verfication ;
